import logo from './logo.svg';
import './App.css';
import PendID from './components/lista_pendientes_ID';
import PendIDTitle from './components/lista_pendientes_ID_Titles';
import Pendsinresolver_ID_Title from './components/lista_pend_sin_resolver_ID_Title';
import PendresueltosIDTitle from './components/lista_pend_resuelto_ID_Title';
import PendIDUserID from './components/lista_pend_ID_UserID';
import PendresueltosIDUserID from './components/lista_pend_resuelto_ID_UserID';
import PendsinresolverIDUserID from './components/lista_pend_sin_resolver_ID_UserID';


const App = () => {
  return (
    <div>
      <pend_ID />
      <pend_ID_Title />
      <pend_sin_resolver_ID_Title />
      <pend_resueltos_ID_Title />
      <pend_ID_UserID />
      <pend_resueltos_ID_UserID />
      <pend_sin_resolver_ID_UserID />
    </div>
  );
};

export default App;
